import React, { Component } from "react";
import Projects from "../tools/projects";
class Nav extends Component {
  state = { expanded: false };
  expand = e => {
    if (this.state.expanded === false) this.setState({ expanded: true });
    else this.setState({ expanded: false });
  };
  render() {
    return (
      <div className="sideNav">
        <Projects expand={this.expand} />
      </div>
    );
  }
}

export default Nav;
